body:
Add a mechanism to specify a directory from where to look for shared libraries

This can be accomplished by using
LiteRtDispatchDelegateOptionsAddSharedLibraryDir(), as in the code below, which
sets the shared library directory to "/data/local/tmp":

   auto dispatch_delegate_options = litert::DispatchDelegateOptionsCreateDefaultPtr();
   LiteRtDispatchDelegateOptionsAddSharedLibraryDir(dispatch_delegate_options.get(), "/data/local/tmp");
   auto dispatch_delegate = litert::DispatchDelegateCreatePtr(std::move(dispatch_delegate_options));
